    false,nt"url": null,nt"notes": "The data sets are generated using the OPTECH
    ALTM 70 kHz LIDAR system mounted onboard AeroMap's twin-engine Cessna 320 aircraft.
    Classified data sets such as this one may have varying posting due to some LIDAR
    pulses not reaching the ground caused by data anomalies. Accuracy statements are
    based on areas of moderate terrain. Diminished accuracies are to be expected in
    areas of extreme terrain and dense vegetation. The accuracy of each point is expected
    to meet the vertical accuracy standard; however, derived products may be less accurate
    in extreme terrain and dense vegetation due to a lesser number of points defining
    the bare-earth in these areas. The data were QA/QC'ed but some data holidays still
    exist. This data represents the last return data only.",nt"owner_org": "e811f0b4-451f-4896-9e8f-fc6802837819",nt"extras":
